  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lee Metcalf
  National Wildlife Refuges outlines Refuge accomplishments during the 1981 calendar
  year. The report begins with an introduction to the Refuge and information about
  climate conditions, habitat conditions, land acquisition, and system status. Construction
  and maintenance are also described. Habitat management is covered; croplands, grasslands,
  and forestlands are discussed. The wildlife section of the report discusses migratory
  birds, big game animals, and raptors. Interpretation and recreation activities are
  outlined; topics include information and interpretation, recreation, and law enforcement.
  Items of interest and safety are discussed.\",\n\t\"license_title\": \"License Not
